/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<li	tabindex="${ifDefined(context._tabIndex)}"	class="ui5-ghli-root ${classMap(context.classes.main)}"	@focusin="${context._onfocusin}"	@focusout="${context._onfocusout}"	@keydown="${context._onkeydown}"	role="option"><span class="ui5-hidden-text">${ifDefined(context.groupHeaderText)}</span><div id="${ifDefined(context._id)}-content" class="ui5-li-content"><span class="ui5-ghli-title"><slot></slot></span></div></li>`; };

export default block0;
